How can I catch the mongodb error to pass the test in jest?<p>I create a user schema using mongoose.</p>

<p>/src/server/models/User.ts:</p>

<pre><code>import { model, Schema } from "mongoose";

export const UserSchema = new Schema({
  address: {
    type: String,
  },
  email: {
    required: true,
    type: String,
    unique: true,
  },
  name: {
    required: true,
    type: String,
    unique: true,
  },
});

const User = model("User", UserSchema);

export default User;
</code></pre>

<p>I try to test the insertion of a user object that missed the name in order to get an error returned back from mongodb:</p>

<p>/src/<strong>tests</strong>/db.spec.ts:</p>

<pre><code>import { MongoMemoryServer } from "mongodb-memory-server";
import mongoose, { Model } from "mongoose";
import { UserSchema } from "../server/models/User";

let mongoServer: MongoMemoryServer;
const opts = {
  useCreateIndex: true,
  useNewUrlParser: true,
  useUnifiedTopology: true,
};

describe("Users", () =&gt; {
  let User: Model&lt;any&gt;;
  beforeAll(async () =&gt; {
    mongoServer = new MongoMemoryServer();
    const mongoUri = await mongoServer.getConnectionString();
    const db = await mongoose.connect(mongoUri, opts);
    User = db.model("User", UserSchema);
  });

  afterAll(async () =&gt; {
    await mongoose.disconnect();
    await mongoServer.stop();
  });

  describe("User Creation", () =&gt; {
    it("Should returns an error if a name is missing", async () =&gt; {
      const newUser = new User({
        address: "address",
        email: "user@gmail.com",
      });
      const createdUser = await User.create(newUser);
      expect(createdUser).toThrow("User validation failed");
    });
  });
});
</code></pre>

<p>The test failed and I got this error:</p>

<pre><code>● Users › User Creation › Should returns an error if a name is missing

    ValidationError: User validation failed: name: Path `name` is required.

      at new ValidationError (node_modules/mongoose/lib/error/validation.js:31:11)
      at model.Object.&lt;anonymous&gt;.Document.invalidate (node_modules/mongoose/lib/document.js:2413:32)
      at p.doValidate.skipSchemaValidators (node_modules/mongoose/lib/document.js:2262:17)
      at node_modules/mongoose/lib/schematype.js:1058:9
</code></pre>

<p>How can I  fix that?</p>

