      at com.fasterxml.jackson.databind.JsonMappingException.wrapWithPath(JsonMappingException.java:394)
      at com.fasterxml.jackson.databind.JsonMappingException.wrapWithPath(JsonMappingException.java:353)
      at com.fasterxml.jackson.databind.deser.BeanDeserializerBase.wrapAndThrow(BeanDeserializerBase.java:1714)
      at com.fasterxml.jackson.databind.deser.BeanDeserializer.deserialize(BeanDeserializer.java:254)
      at com.fasterxml.jackson.databind.deser.BeanDeserializer._deserializeUsingPropertyBased(BeanDeserializer.java:441)
      at com.fasterxml.jackson.databind.deser.BeanDeserializerBase.deserializeFromObjectUsingNonDefault(BeanDeserializerBase.java:1287)
      at com.fasterxml.jackson.databind.deser.BeanDeserializer.deserializeFromObject(BeanDeserializer.java:326)
      at com.fasterxml.jackson.databind.deser.BeanDeserializer.deserialize(BeanDeserializer.java:159)
      at com.fasterxml.jackson.databind.ObjectMapper._readMapAndClose(ObjectMapper.java:4202)
      at com.fasterxml.jackson.databind.ObjectMapper.readValue(ObjectMapper.java:3205)
      at com.fasterxml.jackson.databind.ObjectMapper.readValue(ObjectMapper.java:3173)
      at mongodb.MongoKt.main(mongo.kt:70)
      at mongodb.MongoKt.main(mongo.kt)
  Caused by: com.fasterxml.jackson.core.JsonParseException: Current token (START_OBJECT) not VALUE_STRING or VALUE_EMBEDDED_OBJECT, can not access as binary
   at [Source: (String)"{"_id": {"$oid": "5deb5bb749772bab4217199e"}, "name": "Tom", "sampleId": {"$binary": "a0i407ZPz66d8XbdAZMygQ==", "$type": "03"}}"; line: 1, column: 75]
      at com.fasterxml.jackson.core.JsonParser._constructError(JsonParser.java:1840)
      at com.fasterxml.jackson.core.base.ParserMinimalBase._reportError(ParserMinimalBase.java:712)
      at com.fasterxml.jackson.core.json.ReaderBasedJsonParser.getBinaryValue(ReaderBasedJsonParser.java:467)
      at com.fasterxml.jackson.core.JsonParser.getBinaryValue(JsonParser.java:1484)
      at mongodb.mongo$UUIDDeserializer.deserialize(mongo.kt:41)
      at mongodb.mongo$UUIDDeserializer.deserialize(mongo.kt:39)
      at com.fasterxml.jackson.databind.deser.impl.FieldProperty.deserializeAndSet(FieldProperty.java:138)
      at com.fasterxml.jackson.databind.deser.BeanDeserializer.deserialize(BeanDeserializer.java:252)
