MongoDB Combine/Merge the results of two aggregates?<p>How can I write a query/aggregate that can give me the total number of persons who sent and received a message?
For example, A exists in the "from" field, and A also exists in one of the lists of "To" field then it should be counted.</p>

<pre><code>    { "_id" : 1, "from" : "A", "To" : [B,C,F], "message":"lorem ipsum" }
    { "_id" : 2, "from" : "B", "To" : [A] , "message":"lorem ipsum" }
    { "_id" : 3, "from" : "C", "To" : [A,E] , "message":"lorem ipsum"}
    { "_id" : 4, "from" : "D", "To" : [E] , "message":"lorem ipsum"}
    { "_id" : 6, "from" : "A", "To" : [E,B ], "message":"lorem ipsum" }
</code></pre>

<p>The total number for this example would be 3 (A, B, C), D is not counted as it only sent a message and did not receive any</p>

<p>I have been able to have a distinct list of "from" field, then I unwind the "To" field and got another list. But now I am stuck on how to combine the two results together.</p>

